(4, 'renewable-energy.png', 'Indicadores de Sostenibilidad (KPI)', 'Módulo que permite visualizar y comparar el desempeño ambiental de los diferentes proyectos habilitados en MIMASOFT, a través de distintos indicadores de sostenibilidad. ', 4, 1, NULL, '2019-01-01 00:00:00', NULL, 0),
(5, 'student.png', 'Ayuda y Soporte', 'Módulo que permite consultar información general de la herramienta digital MIMASOFT, además de solicitar soporte para su correcto funcionamiento.', 6, 1, NULL, '2019-01-01 00:00:00', NULL, 0),
(6, 'leaves-2.png', 'Economía Circular', 'Módulo que presenta el desempeño de los proyectos habilitados en MIMASOFT, evaluados con enfoque circular a partir de la metodología CirculAbility de Subsole.', 5, 1, NULL, '0000-00-00 00:00:00', NULL, 0),
(7, 'logos_sostenibilidad_medioambiente.png', 'Consolidado Impactos', 'Dashboard general que totaliza los resultados de todos los proyectos', 7, 1, NULL, '2023-10-31 06:23:35', NULL, 0);
